package sliding_window

//https://leetcode.com/problems/find-all-anagrams-in-a-string/
fun main() {

    findAnagrams("","").forEach {
        println(it)
    }
}

fun isValidAnagram(currentString:String, map:HashMap<Char,Int>):Boolean{

    currentString.forEach {

        if(!map.containsKey(it))
            return false

        var currentFrequency = map.get(it)!!
        if(currentFrequency == 1)
            map.remove(it)
        else{
            map.put(it, --currentFrequency)
        }
    }
    return map.isEmpty()
}

fun findAnagrams(s: String, p: String): List<Int> {

    var i = 0
    var j = 0
    var size = s.length -1
    var resultList = ArrayList<Int>()
    var windowSize = p.length

    var pMap = HashMap<Char,Int>()
    p.forEach {
        var currentFrequency = pMap.getOrDefault(it,0)
        pMap.put(it, ++currentFrequency)
    }

    while (j <= size){

        if(j - i + 1 < windowSize){
            j++
        }
        else{

            if(isValidAnagram(s.substring(i,j+1), pMap.clone() as HashMap<Char, Int>))
                resultList.add(i)

            i++

        }
    }
    return resultList
}